import React from "react";
import Header from "./header";
import Scripts from "./bottomContainer";
import MediaCard from "./Card";

function Project() {
    return (
        <div>
            <Header></Header>
            <div class="container-fluid">

            <div>
                <MediaCard></MediaCard>
            </div>

            </div>
            <Scripts></Scripts>
        </div>
    )
};

export default Project;
